import { BrowserRouter,Routes,Route } from "react-router-dom";
import Home from "./testComponent/Login"


const Routers =() =>{

    return(<>
        <BrowserRouter>
        <Routes>
            <Route path = "/" element = {<Home/>}/>

        </Routes>

        </BrowserRouter>
        </>)
}
export default Routers;
